This is the status quo option. We will continue to append bespoke values to the top level suggestion, and ensure that they're optional. We can continue to use the provider to signal what fields exists and how they should be parsed. For example, we can specify 2 different types of rating, and hence 2 validation strategy for it, based off of which provider is specified. Example: { "suggestions": [ { ... "provider": "addons", "rating": "4.123", ... }, { ... "provider": "movies", "rating": 0.123, ... }, ... ], ...
} The partial JSON Schema validation will look something like: { "type": "object", "properties": { "provider": { "type": "string" } }, "required": ["provider"], "allOf": [ { "if": { "properties": { "provider": { "const": "addons" } } }, "then": { "properties": { "rating": { "type": "string" } }, "required": [ "rating" ] } }, { "if": { "properties": { "provider": { "const": "movies" } } }, "then": { "properties": { "rating": { "type": "number" } }, "required": [ "rating" ] } } ]
} Pros Can specify specific validation per provider. Merino is still kind of immature, so it still might be too early to think about design. Less nesting in the models (resulting in less complexity). Currently, backwards compatible as we don't have to do anything to existing providers, as this follows the existing patterns. Cons Lack of isolation for bespoke fields; ratings is coupled with 2 specific providers, and by just looking at the response, it's not clear that they are related. Not clear what is shared between all suggestions, vs. what is bespoke to specific provider. It is not obvious that the provider field should signal how you should perform validation. In other words, there is a contextual dependency on the JSON structure of suggestion based on provider.

